var searchCaches = [];
function searchSelect(id) {
	var row = searchCaches[id];
	if (!row) {
		return;
	}

	$.each(row, function(k, v){
		$('#block-' + k).val(v);
	});
	curContentid = id;
	$('#block-contentid').val(id);

	if (row.thumb) {
		$('.file-default-preview img:first').attr('src', row.thumb);
	}else{
		$('.file-default-preview img:first').attr('src', staticUrl + 'img/thumb-add.png');
	}
	$('#block-title').popover('hide');
}

function searchInit(searchUrl){
	$('#block-title').popover();
	var searchObj = $('#searchTitleBtn');
	searchObj.click(function(){
		var qstr = $('#block-title').val();		
		if (!qstr){
			tip('Can not be empty', '#block-title', 'bottom');
			return;
		}

		loadShow();
		$.ajax({
			type: "get",
			dataType : 'json',
			url: searchUrl,
			data: { q : qstr },
			timeout:3000,
			crossDomain : true,
			complete : function() {
				loadHide();
			},
			success: function(data){
				if (!data || data.length == 0) {
					return ;
				}
				var html = template('tplSearchRow', {
					  list :data
				});

				$.each(data, function(k, v){
					searchCaches[ toInt(v.id) ] = v;
				});

				$('#block-title').attr('data-content', html);
				$('#block-title').popover('show');

		   }
		});

	});
}